  \"2016-07-27T22:42:00.158061\",\n\t\"name\": \"environmental-contaminants-evaluation-report-proposed-headquarters-site-st-vincent-nationa\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The following report presents the findings
  of a chemical contaminants evaluation on property proposed for acquisition as headquarters
  for the St. Vincent National Wildlife Refuge. The site is approximately two acres
  and is located in Section 1, Township 9 south, Range 8 west, City of Apalachicola,
  Franklin County, Florida. The site is currently the property of the City and could
  be transferred to the U.S. Fish and Wildlife Service if it is found acceptable and
  suitable for Service needs. One consideration involves past usage and the potential
  accumulation of chemical contaminants and other hazardous materials. As recently
  as about 1970, the site was utilized as a location for a municipal sewage treatment
  plant. As such, the facility had four clarifiers, four sludge drying beds, pumping
  equipment, and other apparatus as would normally be associated with such a plant
  (D.O.T. photography, 1972). Ultimately, the plant was closed and disassembled. Subsequent
  to municipal use of the site for sewage treatment, the area was used as a dump/storage
  area for a variety of items including 55 gallon drums, creosote impregnated pilings,
  metal scrap, vehicle parts, oyster shell, and at least one junked metal boat. Based
  on the above, it was determined that a chemical contaminant evaluation was proper
  before any acquisition activities were entered into.\",\n\t\"license_title\": \"License
